mapper.delete:

delete from cal_fault_dispatch


    and solve_id = #{solve_id,jdbcType=INTEGER}


    and emp_code = #{emp_code,jdbcType=NVARCHAR}


    and is_turn = #{is_turn,jdbcType=CHAR}


    and turn_emp_code = #{turn_emp_code,jdbcType=NVARCHAR}


    and turn_datetime = #{turn_datetime,jdbcType=TIMESTAMP}


    and order_datetime = #{order_datetime,jdbcType=TIMESTAMP}


    and longitude = #{longitude,jdbcType=NVARCHAR}


    and latitude = #{latitude,jdbcType=NVARCHAR}


    and order_address = #{order_address,jdbcType=NVARCHAR}


    and enable_flag = #{enable_flag,jdbcType=CHAR}


    and create_user = #{create_user,jdbcType=NVARCHAR}


    and create_timestamp = #{create_timestamp,jdbcType=TIMESTAMP}


    and last_update_user = #{last_update_user,jdbcType=NVARCHAR}


    and last_update_timestamp = #{last_update_timestamp,jdbcType=TIMESTAMP}


    and last_update_remark = #{last_update_remark,jdbcType=NVARCHAR}

mapper.select:

select id, solve_id, emp_code, is_turn, turn_emp_code, turn_datetime, order_datetime, 
longitude, latitude, order_address, enable_flag, create_user, create_timestamp, last_update_user, 
last_update_timestamp, last_update_remark
from cal_fault_dispatch


    and solve_id = #{solve_id,jdbcType=INTEGER}


    and emp_code = #{emp_code,jdbcType=NVARCHAR}


    and is_turn = #{is_turn,jdbcType=CHAR}


